import '../linkedIn.css';
import '../icomoon/style.css'
import * as PropTypes
    from "../../../Library/Application Support/JetBrains/IntelliJIdea2021.1/javascript/extLibs/codota-types/prop-types/15.7.2/@types/prop-types";

function Column(props) {
    return (
        <div className={"column " + props.classes}>
            <div className={"footer_column_header black_color regular-text" + props.invisibleHeader}>{props.header}</div>
            {props.refs.map((object, i) => <a href="index.html" className="href_text black_color">{object}</a>)}
        </div>
    );
}

Column.propTypes = {
    classes: PropTypes.string,
    refs: PropTypes.arrayOf(PropTypes.string),
    invisibleHeader: PropTypes.string,
    header: PropTypes.string
};

function Footer() {
    const first_column = ["About", "Careers", "Advertising", "Small Business"];
    return (
        <div className="footer">
            <div>
                <div className="logo_image"/>
                <img className="footer_logo" src="../images/LinkedIn.svg" alt=""/>
            </div>
            <Column classes="margin-left_69" invisibleHeader="" header="Navigation" refs={first_column}/>
        </div>
    );
}

export default Footer;
